function handleDecryptShareChange() {

    const inputsEl = document.getElementById("decryptInputs")
    const sharesEl = document.getElementById("decryptShares")

    let wanted = sharesEl.valueAsNumber
    const existing = inputsEl.childNodes.length

    // Validate
    if (wanted < 2) {
        wanted = 2
        sharesEl.value = 2
    }

    // Adjust the number of textareas
    if (wanted > existing) {
        for (let i = 0; i < wanted - existing; i++) {
            const ta = document.createElement("textarea")
            ta.placeholder = "Enter a share here"
            ta.addEventListener("input", doDecrypt)
            inputsEl.append(ta)
        }
    } else if (wanted < existing) {
        for (let i = 0; i < existing - wanted; i++) {
            inputsEl.removeChild(inputsEl.lastChild)
        }
    }
}

function doDecrypt() {

    // Collect inputs
    let inputs = []
    document.querySelectorAll("#decryptInputs > textarea").forEach((ta) => {
        inputs.push(ta.value)
    })

    // Check if they are all empty for no-op
    if (inputs.filter(Boolean).length === 0) {
        return
    }

    const res = Recover_fours(inputs)
    const outEl = document.getElementById("decryptOutput")
    const base64regex = /^([0-9a-zA-Z+/]{4})*(([0-9a-zA-Z+/]{2}==)|([0-9a-zA-Z+/]{3}=))?$/

    if (!base64regex.test(res)) {
        outEl.innerText = ""
        setError(res)
    } else {
        outEl.innerText = atob(res)
        setError("")
    }
}
function fillEncryptOutputs(values) {
    const output = document.getElementById("encryptOutput")
    output.innerHTML = ""

    values.forEach((value) => {
        const textarea = document.createElement("textarea")
        textarea.readOnly = true
        textarea.innerHTML = value
        output.appendChild(textarea)
    })
}

function doEncrypt() {

    const thresholdEl = document.getElementById("encryptThreshold")
    const sharesEl = document.getElementById("encryptShares")

    // Validation
    if (sharesEl.valueAsNumber <= 1) {
        sharesEl.value = 2
    }
    if (thresholdEl.valueAsNumber <= 1) {
        thresholdEl.value = 2
    }

    // Ensure threshold isn't higher than shares
    thresholdEl.setAttribute("max", sharesEl.valueAsNumber)
    if (sharesEl.valueAsNumber < thresholdEl.valueAsNumber) {
        thresholdEl.value = sharesEl.value
    }

    // Snag values from the DOM
    const threshold = thresholdEl.valueAsNumber
    const shares = sharesEl.valueAsNumber
    const useAES = document.getElementById("encryptUseAES").checked
    const input = document.getElementById("encryptInput").value

    // Handle no input
    if (input === "") {
        return fillEncryptOutputs(Array(shares).fill(""))
    }

    // Do it!
    const res = Distribute_fours(
        btoa(input),
        shares,
        threshold,
        useAES
    )

    // Update DOM with results
    if (typeof res === "string") {
        setError(res)
        fillEncryptOutputs(Array(shares).fill(""))
    } else {
        setError("")
        fillEncryptOutputs(res)
    }
}
if (!WebAssembly.instantiateStreaming) {
    // Polyfill (e.g. Safari)
    WebAssembly.instantiateStreaming = async (resp, importObject) => {
        const source = await (await resp).arrayBuffer()
        return await WebAssembly.instantiate(source, importObject)
    }
}

function handleInternetConnectivity() {
    document.getElementById("notOffline").style.display = navigator.onLine ? "block" : "none"
}

function handleNotFileSaved() {
    document.getElementById("notFileSaved").style.display = window.location.protocol !== "file:" ? "block" : "none"
}

function setError(msg) {
    document.getElementById("error").style.display = msg ? "block" : "none";
    document.querySelector("#error p").innerHTML = msg;
}

// Clear textareas when pressing Ctrl+S to prevent saving secrets
// Does not work if the user save from the browser menu...
document.addEventListener("keydown", (e) => {
    if (e.ctrlKey && e.key === "s") {
        document.querySelectorAll("textarea").forEach((e) => e.value = "")
    }
})

document.addEventListener("DOMContentLoaded", async () => {
    // Cleanup share code, so that it work offline
    document.getElementById("decryptInputs").innerHTML="";
    document.getElementById("encryptOutput").innerHTML="";

    // Dismissable alert
    document.querySelector("#error button").addEventListener("click", () => setError())
    // Tabs
    document.querySelectorAll("nav ul li").forEach((li) => {
        li.addEventListener("click", () => {
            document.querySelectorAll("nav ul li").forEach((el) => {
                const action = (li === el) ? "add" : "remove"
                el.classList[action]("active")
            })
            document.querySelectorAll("section").forEach((el) => {
                el.style.display = (el.id === li.dataset.section) ? "block" : "none"
            })
            setError("")
        })
    })
    // Security alerts
    window.addEventListener("online", handleInternetConnectivity)
    window.addEventListener("offline", handleInternetConnectivity)
    handleInternetConnectivity()
    handleNotFileSaved()
    // Load WASM file
    try {
        const go = new Go()
        const result = await WebAssembly.instantiateStreaming(fetch(wasmPayloadInlineURL), go.importObject)
        go.run(result.instance)
        // Load Encrypt
        document.querySelectorAll("#encryptThreshold, #encryptShares, #encryptUseAES, #encryptInput").forEach((input) => {
            input.addEventListener("input", doEncrypt)
        })
        // Load Decrypt
        document.getElementById("decryptShares").addEventListener("input", handleDecryptShareChange)
        handleDecryptShareChange()
    } catch (err) {
        setError(err)
    }
});window.addEventListener('DOMContentLoaded', function() {
  // set initial tab
  changeTab('encrypt');
});

function changeTab(activeTab) {
  // loop through tab handles
  document.querySelectorAll('.tabs li').forEach(function(li){
    if (li.children[0].dataset.tab === activeTab) {
      li.classList.add('is-active');
    } else {
      li.classList.remove('is-active');
    }
  });
  
  // loop through content tabs
  document.querySelectorAll('.tab').forEach(function(tab){
    tab.style.display = tab.id === activeTab ? 'block' : 'none';
  });
}
